import 'package:flutter/material.dart';
import 'package:flutter/src/widgets/container.dart';
import 'package:flutter/src/widgets/framework.dart';

class GridView_Example extends StatefulWidget {
  const GridView_Example({super.key});

  @override
  State<GridView_Example> createState() => _GridView_ExampleState();
}

class _GridView_ExampleState extends State<GridView_Example> {
  final List<String> _listitems = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,"
  ];
  @override
  Widget build(BuildContext context) {
    var map = _listitems.map((item) => const Card());
    return Scaffold(
      appBar: AppBar(
        title: Text("Grid View"),
      ),
      body: SafeArea(
        child: Expanded(
          child: Container(
            child: GridView.count(
                crossAxisCount: 2,
                crossAxisSpacing: 10,
                mainAxisSpacing: 10,
                children: _listitems
                    .map((item) => Card(
                          elevation: 10,
                          child: Container(
                            decoration: BoxDecoration(
                                image: DecorationImage(
                              image: NetworkImage(item),
                              fit: BoxFit.cover,
                            )),
                          ),
                        ))
                    .toList()),
          ),
        ),
      ),
    );
  }
}
